import React from 'react'
import ImageItem from './ImageItem';

function ImageList({images}) {
  return (
    <div className="image-list">
        {
        console.log(images)
        }
      {
        images.map((img,index) => {
            return <ImageItem key = {index} image = {img} />
        })
      }
    </div>
  )
}

export default ImageList;
